import React from 'react'
import './App.css'
import Theme from './Theme'
import gallery from './images/gallery.png';
import pinkcloud from './images/pinkcloud.png';



const Gallery = () => {
    return(
        <div id='gallery'>
            <Theme titleBoxStyle='gallery-title-box' titleStyle='gallery-title'  titleValue='CLOUD GALLERY'/>
            <Intro />
            <Photo src={pinkcloud}  alt='pinkcloud' credit='Ian Fisher https://www.ianfisherart.com/gallery/painting'    />
        </div>
    );

}


const Photo = (props) => {
    return(
        <div>
            <img src={props.src} alt={props.name}></img>
            <p>Credit: {props.credit}</p>
        </div>
    );
}

const Intro = ()=> {
    return(
        <div className='introBox'>
            <p className='intro'>A COLLECTION OF MY PERSONAL PICK OF ARTWORKS FROM IAN FISHER, <br/>ONE OF MY FAVOURITE ARTISTS, <br/> WHO IS DEDICATED TO PORTRAIT CLOUDS IN VARIOUS MOODS AND SHAPES. </p>
        </div>
    );
}
export default Gallery;
